  \"A Low-Sidelobe Frequency-Scan Millimeter-Wave Antenna for Cloud and Precipitation
  Sensing Project\",\n\t\"tracking_summary\": {\n\t\t\"total\": 14,\n\t\t\"recent\":
  1\n\t},\n\t\"groups\": [],\n\t\"relationships_as_subject\": [],\n\t\"revision_timestamp\":
  \"2015-05-07T01:13:34.146752\",\n\t\"name\": \"a-low-sidelobe-frequency-scan-millimeter-wave-antenna-for-cloud-and-precipitation-sensing-\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"NASA is committed to measuring clouds on
  a global scale and will soon launch CloudSat, which will carry the first space borne
  cloud-profiling radar (CPR). Operating at 94 GHz, the CPR will conduct a 2 year
  global survey of cloud properties, collecting quantitative information on cloud-layer
  thickness, base and top altitudes, cloud optical thickness, and cloud water and
  ice contents. A follow-on mission is envisioned that will fly a low-mass cross-track
  scanning antenna. This will provide future missions with much improved spatial coverage
  for comparison with numeric models and reduced time between subsequent measurements
  over the same region.rn rnThis proposed Phase I effort will investigate the required
  innovations to design and build a novel airborne prototype W-band (94 GHz) cross-track
  scanning antenna and wideband radar system. The proposed antenna will utilize a
  low-mass offset reflector and a frequency-scanned line-feed to achieve for the first
  time at W-band a cross track scan width of approximately 60 degrees. This design
  will lead to a prototype scanning radar system that can be flown on high-altitude
  platforms such as the NASA ER-2, WB-57 and Proteus. The prototype antenna will be
  compatible with existing space-qualified transmitters and can be scaled for space
  flight.rn\",\n\t\"license_title\": \"U.S. Government Work\",\n\t\"extras\": [{\n\t\t\"key\":
